import React, {Component} from "react"
import "./index.css"

function Item(props){

	const styles= {
		backgroundColor:"red"
	}


	return(
			<div className="item" style={styles}>
				<h3>{props.num.id}. </h3>
				<p>{props.num.task}</p>
				<hr></hr>
			</div>
	);
}

export default Item
